script: |
  super -f text -I q12545.spq | sort > q12545.out

inputs:
  - name: q12545.spq
    data: |
      SELECT col0 + - col0 FROM tab2 (FORMAT parquet) AS cor0 WHERE + ( + col0 ) + + col0 BETWEEN ( - col1 / - CAST ( NULL AS REAL ) * + col1 * col2 ) AND ( - ( - - 96 ) );
  - name: tab2

outputs:
  - name: q12545.out
    data: |
